import logo from "./logo.svg";
import "./App.css";
import MyNavbar from "./layout/MyNavbar";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
function App() {
  return (
    <>
      <MyNavbar />
      <HashRouter>
        <Routes>
          <Route path="about" element={<About />} />
          <Route path="home" element={<Home />} />
        </Routes>
      </HashRouter>
    </>
  );
}

export default App;
